import React, { useState, useEffect } from 'react';
import {
  Box,
  Heading,
  Text,
  SimpleGrid,
  Flex,
  Stat,
  StatLabel,
  StatNumber,
  StatHelpText,
  Badge,
  Progress,
  Spinner,
  Alert,
  AlertIcon,
  Button,
  useToast,
  Card,
  CardHeader,
  CardBody
} from '@chakra-ui/react';
import { 
  FiRefreshCw 
} from 'react-icons/fi';
import { useExpeta } from '../context/ExpetaContext';

const Dashboard = () => {
  const { 
    loadStats, 
    loadHealth, 
    loading, 
    error, 
    systemStats,
    loadSystemStats
  } = useExpeta();

  const [isRefreshing, setIsRefreshing] = useState(false);
  const [health, setHealth] = useState({ 
    status: 'unknown',
    services: {}
  });
  const toast = useToast();

  useEffect(() => {
    if (loadSystemStats) {
      loadSystemStats().catch(err => console.error('Failed to load system stats:', err));
    }
  }, [loadSystemStats]);

  // 刷新数据
  const handleRefresh = async () => {
    setIsRefreshing(true);
    try {
      await Promise.all([loadStats(), loadHealth()]);
      toast({
        title: 'Dashboard refreshed',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    } catch (err) {
      toast({
        title: 'Refresh failed',
        description: err.message,
        status: 'error',
        duration: 3000,
        isClosable: true
      });
    } finally {
      setIsRefreshing(false);
    }
  };

  if (loading) {
    return (
      <Flex justify="center" align="center" height="100vh">
        <Spinner size="xl" />
        <Text ml={4}>加载中...</Text>
      </Flex>
    );
  }

  if (error) {
    return (
      <Box p={4} bg="red.50" color="red.500" borderRadius="md">
        加载失败: {error}
      </Box>
    );
  }

  const statsData = systemStats || {
    expectations: { total: 0, completed: 0 },
    generations: { total: 0, completed: 0 },
    validations: { total: 0, passed: 0 }
  };

  return (
    <Box>
      <Flex justify="space-between" align="center" mb={6}>
        <Heading size="lg">Dashboard</Heading>
        <Button 
          leftIcon={<FiRefreshCw />} 
          colorScheme="blue" 
          variant="outline"
          onClick={handleRefresh}
          isLoading={isRefreshing}
          loadingText="Refreshing"
          size="sm"
        >
          Refresh
        </Button>
      </Flex>

      {/* 错误提示 */}
      {(error.stats || error.health) && (
        <Alert status="error" mb={6} borderRadius="md">
          <AlertIcon />
          {error.stats || error.health}
        </Alert>
      )}

      {/* 系统状态卡片 */}
      <Box
        p={5}
        shadow="md"
        borderWidth="1px"
        borderRadius="md"
        bg="white"
        mb={6}
      >
        <Flex justify="space-between" align="center" mb={4}>
          <Heading size="md">System Status</Heading>
          <Badge
            colorScheme={health.status === 'healthy' ? 'green' : health.status === 'degraded' ? 'yellow' : 'red'}
            fontSize="0.9em"
            p={1}
            borderRadius="md"
          >
            {health.status?.toUpperCase() || 'UNKNOWN'}
          </Badge>
        </Flex>

        <Text color="gray.600" mb={4}>
          Overall system health and component status
        </Text>

        <SimpleGrid columns={{ base: 1, md: 3 }} spacing={4}>
          {/* 组件状态 */}
          {Object.entries(health.services || {}).map(([service, status]) => (
            <Box p={3} shadow="sm" borderWidth="1px" borderRadius="md" key={service}>
              <Flex align="center" mb={2}>
                <Text fontWeight="medium">{service}</Text>
                <Badge
                  ml="auto"
                  colorScheme={status === 'healthy' ? 'green' : status === 'degraded' ? 'yellow' : 'red'}
                  fontSize="0.8em"
                >
                  {status?.toUpperCase() || 'UNKNOWN'}
                </Badge>
              </Flex>
              <Progress 
                size="sm" 
                colorScheme={status === 'healthy' ? 'green' : status === 'degraded' ? 'yellow' : 'red'}
                value={status === 'healthy' ? 100 : status === 'degraded' ? 50 : 0}
              />
            </Box>
          ))}
        </SimpleGrid>
      </Box>

      {/* 统计卡片 */}
      <SimpleGrid columns={{ base: 1, md: 2, lg: 4 }} spacing={6} mb={10}>
        <Card>
          <CardHeader>
            <Heading size="md">期望</Heading>
          </CardHeader>
          <CardBody>
            <Stat>
              <StatLabel>总数</StatLabel>
              <StatNumber>{statsData.expectations.total}</StatNumber>
              <StatHelpText>已完成: {statsData.expectations.completed}</StatHelpText>
            </Stat>
          </CardBody>
        </Card>

        <Card>
          <CardHeader>
            <Heading size="md">生成</Heading>
          </CardHeader>
          <CardBody>
            <Stat>
              <StatLabel>总数</StatLabel>
              <StatNumber>{statsData.generations.total}</StatNumber>
              <StatHelpText>已完成: {statsData.generations.completed}</StatHelpText>
            </Stat>
          </CardBody>
        </Card>

        <Card>
          <CardHeader>
            <Heading size="md">验证</Heading>
          </CardHeader>
          <CardBody>
            <Stat>
              <StatLabel>总数</StatLabel>
              <StatNumber>{statsData.validations.total}</StatNumber>
              <StatHelpText>通过: {statsData.validations.passed}</StatHelpText>
            </Stat>
          </CardBody>
        </Card>
      </SimpleGrid>

      {/* 最近活动 */}
      <Box
        p={5}
        shadow="md"
        borderWidth="1px"
        borderRadius="md"
        bg="white"
        mb={6}
      >
        <Heading size="md" mb={4}>Recent Activity</Heading>
        <Text color="gray.500" fontSize="sm">
          Recent activity will appear here once available
        </Text>
      </Box>
    </Box>
  );
};

export default Dashboard;
